table = {'insert unique keys': {'keys_to_insert': ['a', 'c', 'b', 'd'],
    'expected_dict': {'a': 0, 'c': 1, 'b': 2, 'd': 3}},
    'insert repeated keys': {'keys_to_insert': ['a', 'c', 'b', 'c', 'a',
    'b', 'd'], 'expected_dict': {'a': 0, 'c': 1, 'b': 2, 'd': 3}}}
for test_name, test in iteritems(table):
    self.setUp()
    for key in test['keys_to_insert']:
        self.d.insert(key)
    self.assertEqual(self.d, test['expected_dict'], test_name)
